import getConfig from 'next/config';

const { PRODUCTION, APP_NAME } = getConfig().publicRuntimeConfig;

console.log(APP_NAME, PRODUCTION);

export const API = PRODUCTION ? 'http://blogs.com' : 'http://localhost:8000';

export { APP_NAME };
